contracts/FundMe.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity 0.8.8;

import "./PriceConvertor.sol";

contract FundMe{

    using PriceConvertor for uint256;

    uint256 constant public minimumUSD = 50 * 1e18;
    address[] public funders;
    mapping(address => uint256) public addressToAmount;
    address public owner;

    constructor(){
        owner = msg.sender;
    }

    function fund() public payable{
        require(msg.value.getConversionRate() >= minimumUSD , "Not Enough Ethereum");
        funders.push(msg.sender);
        addressToAmount[msg.sender] += msg.value;
    }
    
    function withdraw() public onlyOwner {
        for(uint256 i=0;i<funders.length;i++){
            address funder = funders[i];
            addressToAmount[funder] = 0;
        }

        funders = new address[](0);

        (bool success,) = payable(msg.sender).call{value :address(this).balance}("");
        require(success,"Withdraw failed");
    }

    modifier onlyOwner {
        require(msg.sender == owner,"Sender is not Owner");
        _;
    }

}

contracts/PriceConvertor.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity 0.8.8;

import {AggregatorV3Interface} from "@chainlink/contracts/src/v0.8/shared/interfaces/AggregatorV3Interface.sol";

library PriceConvertor{

     function getPrice() internal view returns(uint256){
        //Address 0x694AA1769357215DE4FAC081bf1f309aDC325306
        AggregatorV3Interface priceFeed = AggregatorV3Interface(0x694AA1769357215DE4FAC081bf1f309aDC325306);
        (,int price,,,) = priceFeed.latestRoundData();
        return uint256(price*1e18);
    }

    function getVersion() internal view returns (uint256){
        AggregatorV3Interface versionFeed = AggregatorV3Interface(0x694AA1769357215DE4FAC081bf1f309aDC325306);
        return versionFeed.version();
    }

    function getConversionRate(uint256 ethAmount) internal view returns(uint256){
        uint256 ethPriceUSD = getPrice();
        uint256 ethAmountUSD = (ethAmount * ethPriceUSD) / 1e18;
        return ethAmountUSD;
    }

}

